             allocate(ly0n(neqn))
             lsumm=0.0d0
             lg_save=g_save
          do i1=4,4
             pas=dt/i1
                x0n=t
                ly0n=g
                
                if(t>0) then
                   call f(neqn, t, g,  lg_calc)
                   myfeval = myfeval + 1
                   lg_save=lg_calc
                end if
                
                do j=1,i1
                   r=x0n
                   lpre=ly0n;
                   lsumm=lsumm+b(start+1)*lpre
                   
                   do i=1,stage/stage_intern
                      if(j==1 .and. i==1) then
                         lg_calc=lg_save
                      else
                         call f(neqn, r, lpre,  lg_calc)
                         myfeval = myfeval + 1
                      end if
                      lcurrent=lpre+pas*al1*lg_calc
                      lsumm=lsumm+b(start+2+(i-1)*stage_intern)*lcurrent
                      r=x0n+(1+stage_intern*stage_intern*(i-1))*pas*al1
                      do k=2,stage_intern
                         call f(neqn, r, lcurrent,  lg_calc)
                         myfeval = myfeval + 1
                         lpost=2.0d0*lcurrent-lpre+2.0d0*pas*al1*lg_calc
                         lsumm=lsumm+b(start+1+k+(i-1)*stage_intern)*
     *                        lpost
                         r=x0n+al1*(k*k+
     *                        stage_intern*stage_intern*(i-1))*pas
                         lpre=lcurrent
                         lcurrent=lpost
                      end do
                      lpre=lcurrent
                   end do
                   !!! new, if stage is odd
                   if (mod(stage,stage_intern)==1) then
                      call f(neqn, r, lpre,  lg_calc)
                      myfeval = myfeval + 1
                      lcurrent=lpre+pas*al1*lg_calc
                      lsumm=lsumm+b(start+stage+1)*lcurrent
                   end if
                   
                   y(:,i1)=lsumm
                   ly0n=lsumm
                   lsumm=0.0d0
                   
                   x0n=x0n+pas
                end do 
             end do
             deallocate(lsumm)
             deallocate(lpre)
             deallocate(lpost)
             deallocate(lcurrent)
             deallocate(lg_calc)
             deallocate(lg_save)
             deallocate(ly0n)
!$OMP END SECTIONS
           else 
!$            iam=OMP_GET_NUM_THREADS()
              noway=1;
           end if
!$OMP CRITICAL (FEVAL)
           feval=feval+myfeval
!$OMP END CRITICAL (FEVAL)
!$OMP END PARALLEL 
!$    ftpa=omp_get_wtime();
           timepa=timepa+ftpa-stpa

           if (noway==1) then
              write(*,*) '========================================'
              write(*,*) iam, 'threads are not supported!!!'
              write(*,*) '========================================'
              exit
           end if 

!$    ster=omp_get_wtime();
          ! Preparation for error calculation
           g_oth=g
!$OMP PARALLEL DEFAULT(NONE) SHARED(neqn,g,y,coeff1,coeff2)
!$OMP& SHARED(coeff3,coeff4)
!$OMP DO
           do l=1, neqn
              g(l)=coeff4*y(l,4)-
     *            coeff3*y(l,3)+coeff2*y(l,2)-coeff1*y(l,1)
           end do
!$OMP END DO
!$OMP END PARALLEL

          ! Error calculation
          err=0.0d0
!$OMP PARALLEL DO DEFAULT(NONE) PRIVATE(sc_nr)
!$OMP& SHARED(g,g_oth,tol,neqn,y,coeff1err,coeff2err)
!$OMP& SHARED(coeff3err,coeff4err)
!$OMP& REDUCTION(+:err)
          do l=1, neqn
             sc_nr = tol + tol*max(g(l),g_oth(l))
             err=err+((
     *              -coeff1err*y(l,1)+coeff2err*y(l,2)
     *              -coeff3err*y(l,3)+coeff4err*y(l,4))*2.0d0/sc_nr)**2
          end do
!$OMP END PARALLEL DO
!$    fter=omp_get_wtime();
          timeer=timeer+fter-ster

!$    stre=omp_get_wtime();      
